subSubSection.paragraph:
Male genitalia
: penis tubular, short, evenly tapering towards apex in dorsal view (
Fig. 18
); in lateral view completely covered by a dorsal translucid, membranous extension of the basal piece, nearly straight, more curved proximally close to articulation with basal piece (
Figs. 18–19
). Permanently everted internal sac drawn out into a long and broad, colorless or yellow flagellum tapering towards apex. Parameres slightly shorter than the basal piece, apically broadly spatulate, slightly angulate at inner margin, with marginal fringe of short setae entirely enclosed in the cuticle (not represented in figure). Basal piece elongate, sclerotized, nearly parallel-sided; ventrally mostly membranous, dorsally with a moderately broad, nearly parallel-sided sclerotic area along midline (
Figs. 18– 19
). A pair of long, slender struts run along basal piece, from penis articulation to slightly beyond the base of the short, truncate expansion of basal piece.
